import { ParallaxLayer } from '@react-spring/parallax';
import React from 'react';
import Breadcrumbs from './Breadcrumbs';

const Contact = () => {
  return (
      <div id='contact'>
        <ParallaxLayer offset={1} speed={0.8}>
          <h1>Contact</h1>
        </ParallaxLayer>
        {/* <ParallaxLayer offset={3.05} speed={0.8}>
          <Breadcrumbs />
        </ParallaxLayer> */}
      </div>
  )
};

export default Contact;
